/* eslint-disable object-shorthand */
import Lottie from "react-lottie";

import { makeStyles, useTheme } from "@mui/styles";
import Grid from "@mui/material/Grid";
import { Button } from "@mui/material";
import animationData from "../animations/landinganimation/data";
import ButtonArrow from "./ui/ButtonArrow";
import Typography from "@mui/material/Typography";

const useStyles = makeStyles(() => ({
  content: {
    height: "1000px",
    width: "100%",
  },
  animation: {
    maxWidth: "50em !impotrant",
    minWidth: "21em !impotrant",
    marginTop: "2em !impotrant",
    marginLeft: "10% !impotrant",
  },
  estimateButton: {
    ...theme.typography.estimate,
    backgroundColor: theme.palette.common.orange,
  },
}));

const LandingPage = () => {
  const classes = useStyles();
  const defaultOptions = {
    loop: true,
    autoplay: true,
    animationData: animationData,
    rendererSettings: {
      preserveAspectRatio: "xMidYMid slice",
    },
  };

  return (
    // <div className={classes.content}>
    <Grid container direction="column">
      <Grid item>
        <Grid container direction="row" alignItems="center" justifyContent="flex-end">
          <Grid item>
            <Typography align="center" justifyContent="center" variant="h2">
              Lorem ipsum dolor sit amet, consectetur adipiscing elit,
              <br /> sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.
            </Typography>
            <Grid container justifyContent="center">
              <Grid item>
                <Button classname={classes.estimateButton} variant="contained">
                  Free estimate
                </Button>
              </Grid>
              <Grid item>
                <Button variant="outlined">
                  Learn more <ButtonArrow width={20} height={20} fill="violet" />
                </Button>
              </Grid>
            </Grid>
          </Grid>
          <Grid sm item className={classes.animation}>
            <Lottie options={defaultOptions} width="500px" height="auto" />;
          </Grid>
        </Grid>
      </Grid>
    </Grid>
    // </div>
  );
};
export default LandingPage;
